Bug 1136763 - Part 3: Test demonstrating that `duplicateMovieClip` now handles empty names correctly

Content of the test file:

```
var mc:MovieClip = this.createEmptyMovieClip("container", 1);
var copy = mc.duplicateMovieClip(null, 2);
trace(copy._name === 'null');
var copy = mc.duplicateMovieClip(undefined, 3);
trace(copy._name === 'undefined');
var copy = mc.duplicateMovieClip('', 4);
trace(copy._name === '');
 ```

Add build.js optimization pass to fold identifiers of the form |XXX_....|.

This helps a lot in interpreter loops since table switches are not emitted for this case:

var OP_add = 0;
var OP_sub = 1;

switch (op) {
  case OP_add: ... break;
  case OP_sub: ... break;
}

This pass transforms the code above as follows:

var OP_add = 0;
var OP_sub = 1;

switch (op) {
  case 0: ... break;
  case 1: ... break;
}
